import axios from 'axios';

export const api = axios.create({
  baseURL: 'http://localhost:7878',
  timeout: 10000,
  withCredentials: true,
  transformRequest: [(data) => JSON.stringify(data.data)],
  headers: {
    'Accept': 'application/json',
    'Content-Type': 'application/json',
  }
});
